import '../../../data/models/applied_data_dto.dart';class AppliedData {  AppliedData({    this.id,    this.employeeName,    this.qualification,    this.cityName,    this.idNumber,    this.phoneNumber,    this.statusName,    this.status,    this.deservedAmount,    this.listAllowEditOpp,    this.freelanceIcon,  });  int? id;  String? employeeName;  String? qualification;  String? cityName;  String? idNumber;  String? phoneNumber;  String? statusName;  String? freelanceIcon;  int? status;  double? deservedAmount;  List<ListAllowEditOpp>? listAllowEditOpp;  factory AppliedData.fromDto(AppliedDataDto dto) {    return AppliedData(      listAllowEditOpp: dto.listAllowEditOpp?.map((e) => ListAllowEditOpp.fromDto(e)).toList(),      id: dto.id,      employeeName: dto.employeeName,      qualification: dto.qualification,      cityName: dto.cityName,      idNumber: dto.idNumber,      freelanceIcon: dto.freelanceIcon,      phoneNumber: dto.phoneNumber,      statusName: dto.statusName,      status: dto.status,      deservedAmount: dto.deservedAmount,    );  }}class ListAllowEditOpp {  ListAllowEditOpp({    this.statusCode,    this.description,  });  int? statusCode;  String? description;  factory ListAllowEditOpp.fromDto(ListAllowEditOppDto dto) {    return ListAllowEditOpp(      statusCode: dto.statusCode,      description: dto.description,    );  }}